function Cards ([card, onCardClick]) {
    function handleClick() {
        onCardClick(card);
    }

    return(
        <div className="element">
          <button  className="element__bin" type="button"></button>
          <img onClick={handleClick} className="element__image" src={card.link} alt={card.name} />
          <div className="element__info">
            <h2 className="element__text">{card.name}</h2>
            <div className="element__likes">
              <button className="element__heart" type="button" id="likebutton"></button>
              <span className="element__like-count">{Object.keys(card.likes).length}</span>
            </div>
          </div>
        </div>
    )
}

export default Card;
